    } else {
      _cachePos[3] = pos;
    }  
    // => Prefix+ # Choice
    switch (_getState(_transitions1)) {
      // [!-\"] [&-(] [.] [A-[] [_] [a-z]
      // EOF
      case 0:
      case 2:
        var startPos0 = _startPos;
        _startPos = _cursor;
